    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <Nav defaultActiveKey="/home" className="flex-column" style={MyStyle.col_border}>
            <Nav.Link style={linkStyle} onMouseEnter={this.toggleHover} style={MyStyle.col_border} href="/home">Active</Nav.Link>
            <Nav.Link style={MyStyle.col_border} eventKey="link-1">Link</Nav.Link>
            <Nav.Link style={MyStyle.col_border} eventKey="link-2">Link</Nav.Link>
            <Nav.Link style={MyStyle.col_border} eventKey="link-3">Disabled</Nav.Link>
        </Nav>
         );
    }
}
 
export default Sidebar;

